import React from 'react'
import {Link} from 'react-router-dom';

const Navbar = () => {
    return (
        <div>
        <header>
            <img src="" alt="Logo" />
        </header>
            <navbar>
                <Link to="/">Home</Link><br/>
                <Link to="/signup">Signup</Link><br/>
                <Link to="/product">Products</Link>
            </navbar>
        </div>
    )
}

export default Navbar;
